import "./index.css";

const personajes = ["Rimuru", "Ciel", "Kaguya", "Shirogane"];

const [, , p3] = personajes;

console.log(p3);

const retornarArreglo = () => {
  return ["ABC", 123];
};

const [, numeros] = retornarArreglo();

console.log(numeros);
